@import url('https://fonts.googleapis.com/css2?family=Poppins:wght@400;500;600;700&family=Ubuntu:wght@400;500;700&display=swap');

* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
    text-decoration: none;
}

html {
    scroll-behavior: smooth;
}

/* navbar-nb styling */

.max-width {
    max-width: 1300px;
    padding: 0px 80px;
    margin: auto;
}

.navbar-nb {
    position: fixed;
    width: 100%;
    padding: 30px 0;
    font-family: 'Ubuntu', 'sans-serif';
    transition: all 0.3s;
    z-index: 999;
}

.navbar-nb.sticky {
    background: maroon;
    padding: 15px 0;
}

.navbar-nb .max-width {
    display: flex;
    align-items: center;
    justify-content: space-between;
}

.navbar-nb .logo a {
    color: #fff;
    font-size: 35px;
    font-weight: 600;
}

.navbar-nb .logo a span {
    color: crimson;
    transition: all 0.3s;
}

.navbar-nb.sticky .logo a span {
    color: #fff;
}

.navbar-nb li {
    list-style: none;
    display: inline-block;
}

.navbar-nb .menu li a {
    color: #fff;
    font-size: 18px;
    font-weight: 500;
    margin-left: 25px;
    transition: color 0.3s;
}

.navbar-nb .menu li a:hover {
    color: crimson;
}

/* menu btn styling */

.menu-btn {
    color: #fff;
    cursor: pointer;
    font-size: 23px;
    display: none;
}

/* home section styling */

.home {
    display: flex;
    background: url("assets/background-main2.jpg") no-repeat center;
    background-size: cover;
    height: 100vh;
    background-attachment: fixed;
    color: #fff;
    min-height: 500px;
    font-family: 'Ubuntu', 'sans-serif';
}

.home .max-width {
    margin: auto 0 auto 40px;
}

.home .home-content .text-1 {
    font-size: 21px;
}

.home .home-content .text-2 {
    font-size: 75px;
    font-weight: 500;
    margin-left: -3px;
}

.home .home-content .text-3 {
    font-size: 40px;
    margin: 5px 0;
}

.home .home-content .text-3 span {
    color: crimson;
    font-weight: 500;
}

.home .home-content a {
    display: inline-block;
    background: crimson;
    color: #fff;
    padding: 10px 30px;
    border-radius: 6px;
    font-size: 20px;
    margin-top: 20px;
    border: 2px solid crimson;
    transition: all 0.3s;
}

.home .home-content a:hover {
    background: none;
    color: crimson;
}

/* section styling */

section {
    padding: 80px 0;
}

section .title {
    position: relative;
    text-align: center;
    font-size: 40px;
    font-weight: 500;
    margin-bottom: 50px;
    padding-bottom: 20px;
    font-family: 'Ubuntu', sans-serif;
}

section .title::before {
    content: "";
    position: absolute;
    bottom: 0px;
    left: 50%;
    width: 180px;
    height: 3px;
    background: #111;
    transform: translateX(-50%);
}

section .title::after {
    position: absolute;
    bottom: -12px;
    left: 50%;
    font-size: 20px;
    color: crimson;
    padding: 5px;
    background: #fff;
    transform: translateX(-50%);
}

/* About section styling */

.about, .services, .portfolio {
    font-family: 'Poppins', sans-serif;
}

.about .title::after {
    content: "who i am";
}

.about .about-content,
.services .serv-content,
.portfolio .card-pf .row-nb {
    display: flex;
    flex-wrap: wrap;
    align-items: center;
    justify-content: space-between;
}

.about .about-content .left {
    width: 45%;
}

.about .about-content .left img {
    height: 400px;
    width: 400px;
    object-fit: cover;
    border-radius: 10px;
}

.about .about-content .right {
    width: 55%;
}

.about .about-content .right .text {
    font-size: 25px;
    font-weight: 600;
    margin-bottom: 10px;
}

.about .about-content .right .text span {
    color: crimson;
}

.about .about-content .right p {
    text-align: justify;
}

