/* services section styling */

.services {
    background: #111;
    color: #fff;
}

.services .title::before {
     background: #fff;
}

.services .title::after {
    background: #111;
    content: "Tech. Stack";
}

.services .serv-content .card {
    width: calc(33% - 20px);
    background: #222;
    text-align: center;
    border-radius: 6px;
    padding: 20px 25px;
    cursor: pointer;
}

.services .serv-content .card:hover {
    background: crimson;
}

.services .serv-content .card .text {
    font-size: 25px;
    font-weight: 500;
    margin: 10px 0 7px 0;
}

.services .serv-content .card .box {
    transition: all 0.3s;
}

.services .serv-content .card:hover .box {
    transform: scale(1.05);
}


/* portfolio section stying */

.portfolio .title::after {
    content: "some works";
}

.portfolio .card-pf {
    margin-bottom: 20px;
}
.portfolio .card-pf img {
    width: 33%;
    object-fit: cover;
    border-radius: 10px;
}

.portfolio .body-pf {
    width: 64%;
    margin: 10px;
}

.portfolio .body-pf a {
    display: inline-block;
    background: crimson;
    color: #fff;
    padding: 8px 25px;
    border-radius: 6px;
    font-size: 15px;
    margin-top: 20px;
    border: 2px solid crimson;
    transition: all 0.3s;
}

.portfolio .body-pf a:hover {
    background: none;
    color: crimson;
}

.portfolio .body-pf p {
    text-align: justify;
}

/* footer styling */

footer {
	background-color: rgba(0, 0, 0, 0.9);
    padding: 25px;
    font-weight: bold;
    text-align: center;
    font-family: 'Ubuntu', sans-serif;
}

div ul {
    padding-left: 0;
}

footer .social-share ul li {
	list-style: none;
	display: inline-block;
	vertical-align: middle;
}

footer .social-share ul li a {
    padding: 10px;
    text-align: center;
}

.logo-kontak {
    width : 25px;    
}

footer .footer-bawah {
	width: 100%;
	font-size: 13px;
	color: #fff;
}


/* responsive media query start */

@media (max-width: 1300px) {
    .home .max-width {
        margin-left: 0px;
    }
}

@media (max-width: 1104px) {
    .about .about-content .left img {
        height: 350px;
        width: 350px;
    }
}

@media (max-width: 991px) {
    .max-width {
        padding: 0 50px;
    }
}

@media (max-width: 900px) {
    .menu-btn {
        display: block;
        z-index: 999;
    }

    .menu-btn i.active:before {
        content: "\f00d";
    }

    .navbar-nb .menu {
        position: fixed;
        background: #111;
        left: -100%;
        top: 0;
        height: 100vh;
        width: 100%;
        text-align: center;
        padding-top: 80px;
        transition: all 0.3s;
    }

    .navbar-nb .menu.active {
        left: 0;
    }

    .navbar-nb .menu li {
        display: block;
    }

    .navbar-nb .menu li a {
        display: inline-block;
        margin: 20px 0;
        font-size: 25px;
    }

    .home .home-content .text-2 {
        font-size: 70px;
    }

    .home .home-content .text-3 {
        font-size: 35px;
    }

    .home .home-content a {
        font-size: 18px;
        padding: 8px 27px;
    }

    .max-width {
        max-width: 800px;
    }

    .about .about-content .column {
        width: 100%;
    }

    .about .about-content .left {
        display: flex;
        justify-content: center;
        margin: 0 auto 60px;
    }

    .about .about-content .right {
        flex: 100%;
    }

    .services .serv-content .card {
        width: calc(50% - 10px);
        margin-bottom: 20px;
    }
}

@media (max-width: 690px) {
    .max-width {
        padding: 0 23px;
    }

    .home .home-content .text-2 {
        font-size: 60px;
    }

    .home .home-content .text-3 {
        font-size: 32px;
    }

    .home .home-content a {
        font-size: 16px;
        /* padding: 6px 24px; */
    }

    .services .serv-content .card {
        width: 100%
    }

    .portfolio .card-pf img {
        width: 100%;
        margin-bottom: 10px;
    }

    .portfolio .body-pf {
        width: 100%;
    }
}

@media (max-width: 500px) {
    .home .home-content .text-2 {
        font-size: 50px;
    }

    .home .home-content .text-3 {
        font-size: 27px;
    } 
}
